import { combineReducers } from 'redux';
import fetchAPI from '../reducers/fetchAPI';
import SlidePop from "./slidePop";
import {reducer as form} from "redux-form"

const allReducers = combineReducers({
    fetchAPI,
    SlidePop,
    form
});
export default allReducers;
